import React, { useState, useEffect } from "react";
import UserService from "../services/user.service";
const BoardUser = () => {
  const [content, setContent] = useState("");
  useEffect(() => {
    UserService.getUserBoard().then(
      (response) => {
        setContent(response.data);
      },
      (error) => {
        const _content =
          (error.response &&
            error.response.data &&
            error.response.data.message) ||
          error.message ||
          error.toString();
        setContent(_content);
      }
    );
  }, []);
  return (
    <div className="container max-w-none mx-auto board-user">
      <div className="container mx-auto">
        <div className="grid grid-cols-12 gap-2 board-grid">
          <div className="col-span-3 box shadow">
            <h2><i className="fa-solid fa-sack-dollar"></i> Net Worth</h2>
            <p>5845,56.25 USD</p>
          </div>
          <div className="col-span-3 box shadow">
          <h2><i className="fa-solid fa-sack-dollar"></i> Staking</h2>
            <p>1845,16.05 USD</p>
          </div>
          <div className="col-span-3 box shadow">
          <h2><i className="fa-solid fa-sack-dollar"></i> Yield</h2>
            <p>45.56 USD</p>
          </div>
          <div className="col-span-3 box shadow">
          <h2><i className="fa-solid fa-sack-dollar"></i> APY</h2>
            <p>12%</p>
          </div>
        </div>
        <div className="grid grid-cols-12 gap-2 board-grid">
          <div className="col-span-6 box shadow">1</div>
          <div className="col-span-6 box shadow">2</div>
        </div>
      </div>
    </div>
  );
};
export default BoardUser;
